// Customize the background used each turn!
// This function runs at the start of each turn.
// The default background is available as DEFAULT_BG.
// Additional backgrounds are available as ADDITIONAL_BG_#,
// e.g. ADDITIONAL_BG_1 for the first added background.

//800979F0 holds s32 bool for if process is running (old)
//800A1904 holds s16 for current music index
//80097A00 starts code for hooking initCameras

#include "ultra64.h"


#define EXEC_PROCESS_DEFAULT 0
#define EXEC_PROCESS_SLEEPING 1
#define EXEC_PROCESS_WATCH 2
#define EXEC_PROCESS_DEAD 3

typedef void (*process_func)();

typedef struct jump_buf
{
    u32 * sp;
    void *func;
    u32 regs[21];
} jmp_buf;

typedef struct Process {
    /*0x00*/ struct Process *next;
    /*0x04*/ struct Process *youngest_child;
    /*0x08*/ struct Process *oldest_child;
    /*0x0C*/ struct Process *relative;
    /*0x10*/ struct Process *parent_oldest_child;
    /*0x14*/ struct Process *new_process;
    /*0x18*/ void *heap;
    /*0x1C*/ u16 exec_mode;
    /*0x1E*/ u16 stat;
    /*0x20*/ u16 priority;
    /*0x22*/ s16 dtor_idx;
    /*0x24*/ s32 sleep_time;
    /*0x28*/ void *base_sp;
    /*0x2C*/ jmp_buf prc_jump;
    /*0x88*/ process_func destructor;
    /*0x8C*/ void *user_data;
} Process;

extern s16 D_800A1904;
extern s8 D_800D1124;
extern s32 D_801057F0;
extern Process* D_80097830;


typedef struct Vec2s {
	s32 xPos;
	s32 yPos;
} Vec2s;

typedef struct Vec2f {
	f32 xPos;
	f32 yPos;
} Vec2f;

typedef struct unkHudStruct {
	/* 0x00 */ char unk_00[0x05];
	/* 0x05 */ u8 isInvisibleBool;
	/* 0x06 */ char unk[8];
	/* 0x0E */ s16 unk_0E;
	/* 0x10 */ Vec2f coords;
	/* 0x18 */ char unk_08[0x54];
} unkHudStruct;

typedef struct imageStruct {
	s32 mainFSID;
	s32 xPos;
	s32 yPos;
	f32 xScale;
	f32 yScale;
	s32 imageBankIndex;
} imageStruct;

extern unkHudStruct D_801057E0[4];
extern s8 D_800CD096[4];

/*
Vec2f pageDisplayXYOffsets[] = {
    {30, 48}, //p1
    {30, 48}, //p2
    {30, -10}, //p3
    {30, -10} //p4
};
*/

int pageDisplayXYOffsets[] = {
    30, 48, //p1
    30, 48, //p2
    30, -10, //p3
    30, -10, //p4
};

f32 playerHudPositions[] = {
24, 16,
191, 16,
24, 186,
191, 186,
};

extern s32 D_800CDD70[0x100];

void InitProcess(void*, s32 priority, s32 stackSize, s32 unk);

void playerPageIconLoop(void) {
	imageStruct image;
	s32 imageIndexes[4];

	//SleepProcess(15);

	for (int i = 0; i < 4; i++) {
		image.mainFSID = 0x0013020D;
		image.xPos = pageDisplayXYOffsets[(i * 2)] + (f32)D_801057E0[i].coords.xPos;
		image.yPos = pageDisplayXYOffsets[(i * 2) + 1] + (f32)D_801057E0[i].coords.yPos;
		image.xScale = 0.5f;
		image.yScale = 0.5;
		image.imageBankIndex = D_800CD096[i];
		imageIndexes[i] = createImageWithIndexUpdated(&image);
    }

	while (1) {
		for (int i = 0; i < 4; i++) {
			if (D_800CDD70[D_800CD096[i]] == 0) {
				EndProcess(0);
				return;
        	}
			//update image bank index
			if (D_800CD096[i] <= 10 && D_800CD096[i] >= 0) { //if greater than 10, it will crash
				func_80055140(imageIndexes[i], 0, D_800CD096[i], 0);
            } else {
				func_80055140(imageIndexes[i], 0, 0, 0); //use bank index 0
            }

			if (D_801057E0[i].isInvisibleBool == 1) {
				scaleImage(imageIndexes[i], 0, 0.0f, 0.0f);
			} else {
				if (D_801057E0[i].coords.xPos != playerHudPositions[i * 2] ||
					D_801057E0[i].coords.yPos != playerHudPositions[i * 2 + 1])
                {
					scaleImage(imageIndexes[i], 0, 0.0f, 0.0f);
                } else {
					scaleImage(imageIndexes[i], 0, 0.5f, 0.5f);
                }

            }

			SleepVProcess();
        }
    }
	for (int i = 0; i < 4; i++) {
		scaleImage(imageIndexes[i], 0, 0.0f, 0.0f);
    }

	while (1) {
		SleepVProcess();
    }
}

