asm(
"insertHook:\n"
"LI t0, 0x800F5DD0\n"
"LI t1, hookJumpInstruction\n"
"LW t1, 0x0000 (t1)\n" //load jump instruction
"SW t1, 0x0000 (t0)\n"
"JR RA\n"
"NOP\n"
);


asm(
"hookJumpInstruction:\n"
"J hookCode\n"
);

asm(
"hookCode:\n"
"LI t0, 0x80097830\n"
"ORI t1, r0, 0x0001\n"
"SW t1, 0x0000 (t0)\n"
"JR RA\n"
"NOP\n"
);


asm(
"createImageWithIndexUpdated:\n"
//args:
//a0 = pointer to struct for args
"ADDIU sp, sp, -0x50\n"
"SW ra, 0x0020 (sp)\n"
"SW s0, 0x0024 (sp)\n"
"SW s1, 0x0028 (sp)\n"
"SW s2, 0x002C (sp)\n"
"SW s3, 0x0030 (sp)\n"
"SW s4, 0x0034 (sp)\n"

"ADDU s4, a0, r0\n"

"ORI a0, r0, 1\n"
"JAL 0x8005279C\n" //create image struct?
"ORI a1, r0, 5\n"
"ADDU s1, v0, r0\n" //move image index ID to s1

"JAL ReadMainFS\n"
"LW a0, 0x0000 (s4)\n" //load mainFS ID

"BEQL r0, v0, nullPtr\n"
"ADDIU v0, r0, 0xFFFF\n" //return -1
"ADDU s2, v0, r0\n" //move mainFS malloc pointer to s2

"JAL ImgPackParse\n"
"ADDU a0, s2, r0\n" //mainFS returned ptr

"ADDU s3, v0, r0\n" //imgPackParse result to s3
"JAL FreeMainFS\n"
"ADDU a0, s2, r0\n" //mainFS returned ptr


"ADDU a0, s1, r0\n"
"ORI a1, r0, 0\n"
"ADDU a2, s3, r0\n"
"JAL 0x80055024\n"
"ORI a3, r0, 0\n"

"ADDU a0, s1, r0\n"
"ORI a1, r0, 0\n"
"JAL 0x80055294\n"
"ORI a2, r0, 10\n"

"ADDU a0, s1, r0\n"
"ORI a1, r0, 0\n"
"JAL 0x800550F4\n"
"ORI a2, r0, 1\n"

"//load image bank index function call\n"
"ADDU a0, s1, r0\n" //image index ID to a0
"ADDU a1, r0, r0\n"
"LW a2, 0x0014 (s4)\n"
"JAL 0x80055140\n"
"ADDU a3, r0, r0\n"

"ADDU a0, s1, r0\n"
"ORI a1, r0, 0\n"
"LW a2, 0x0004 (s4)\n" //load xPos
"JAL 0x80054904\n"
"LW a3, 0x0008 (s4)\n" //load xPos


"ADDU a0, s1, r0\n"
"ORI a1, r0, 0\n"
"LW a2, 0x000C (s4)\n" //load xScale
"JAL scaleImage\n"
"LW a3, 0x0010 (s4)\n" //load yScale

"ADDU v0, s1, r0\n" //return sprite id of created sprite
"nullPtr:\n"
"LW ra, 0x0020 (sp)\n"
"LW s0, 0x0024 (sp)\n"
"LW s1, 0x0028 (sp)\n"
"LW s2, 0x002C (sp)\n"
"LW s3, 0x0030 (sp)\n"
"JR RA\n"
"ADDIU sp, sp, 0x50\n"
);

asm(
"scaleImage:\n" //a0 = spriteID, a1 = 0, a2 = x scalor, a3 = y scalor
"SLL a0, a0, 16\n"
"SRA a0, a0, 14\n"
"LUI at, 0x800D\n"
"ADDU at, at, a0\n"
"LW a0, 0xDD70 (at)\n"
"SLL a1, a1, 16\n"
"SRA a1, a1, 14\n"
"ADDU a1, a1, a0\n"
"LW v1, 0x0010 (a1)\n"
"SW a2, 0x0060 (v1)\n"
"JR RA\n"
"SW a3, 0x0064 (v1)\n"
);

